export class FriendProfile extends Component{
    constructor(props){
        super(props);
        this.state = {
            currentUser:{}
        }
    }

    componentDidMount(){
        let params = queryString.parse(this.props.location.search)
    }

    render() {
        // const {currentUser} = this.state;
